script: |
  super -f text -I q3632.spq | sort > q3632.out

inputs:
  - name: q3632.spq
    data: |
      SELECT DISTINCT SUM ( DISTINCT - - 96 ) AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q3632.out
    data: |
      96
